window.bookSummaryJSON = "<p>Before World War II could reach its conclusion, the world suffered what could only be defined as a cataclysm. Now, Yosemite city stands as the gateway between two worlds and an equal power in the continent. Unfortunately, it’s surrounded on all sides by those who would love to see them fail: the empire in the west, a king to the east, and the tri-lliance of the wastes to the south.</p> <p>Standing at the top of Yosemite is the warrior king Vince, a ranger turned city state ruler. Supporting him in his endeavors is his inner circle. With a firm grasp on Yosemite, Vince has solidified his borders. He’s gotten the army trained to an elite status. He’s given his people a peaceful lifestyle with an economy that grows year over year. Yosemite is well and truly prospering.</p> <p>There is a delicate balance between nations in military and trade, however. One that is going to be upended with a skirmish in the lands of southern Yosemite.</p> <p>The bullseye Vince had worked so hard to remove is back, and bigger than ever. All anyone can do now is prepare for the storm.</p> <p><i>Warning: This novel contains adult themes and moral ambiguities. The main character is portrayed as a real person in an apocalypse and will not make choices that line up with society and cultural norms.</i></p> <p><i>This story contains a harem and is an Adult Fantasy novel.</i></p>"; 
